import React, { useState } from 'react';
import {
  Container,
  Typography,
  Grid,
  Paper,
  Button,
  Select,
  MenuItem,
  Table,
  TableBody,
  TableCell,
  TableHead,
  TableRow,
  IconButton,
} from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';

const Dashboard = () => {
  const [asset, setAsset] = useState('');
  const [indicator1, setIndicator1] = useState('');
  const [indicator2, setIndicator2] = useState('');
  const [indicator3, setIndicator3] = useState('');
  const [trades, setTrades] = useState([]);

  const handleSubmit = () => {
    const newTrade = {
      asset,
      indicators: [indicator1, indicator2, indicator3],
    };
    setTrades([...trades, newTrade]);

    // Reset fields after submission
    setAsset('');
    setIndicator1('');
    setIndicator2('');
    setIndicator3('');
  };

  const handleDelete = (index) => {
    const updatedTrades = trades.filter((_, i) => i !== index);
    setTrades(updatedTrades);
  };

  // Get available indicators
  const availableIndicators = [
    'Trend',
    'RSI',
    'Moving Average',
    'MACD',
    'Bollinger Bands',
    'Stochastic Oscillator',
  ].filter((indicator) => ![indicator1, indicator2, indicator3].includes(indicator));

  return (
    <Container>
      <Typography variant="h4" gutterBottom>
        Dashboard
      </Typography>
      <Grid container spacing={3}>
        {/* Trade Logging Section */}
        <Grid item xs={12}>
          <Paper elevation={3} style={{ padding: '16px' }}>
            <Typography variant="h6" gutterBottom>
              Log a Trade
            </Typography>

            {/* Step 1: Select Asset */}
            <Typography>Select Asset:</Typography>
            <Select
              value={asset}
              onChange={(e) => setAsset(e.target.value)}
              fullWidth
              style={{ marginBottom: '16px' }}
            >
              <MenuItem value="Bitcoin">Bitcoin</MenuItem>
              <MenuItem value="Apple">Apple</MenuItem>
              {/* Add more assets as needed */}
            </Select>

            {/* Step 2: Select First Confluence Indicator */}
            <Typography>Select First Confluence Indicator:</Typography>
            <Select
              value={indicator1}
              onChange={(e) => setIndicator1(e.target.value)}
              fullWidth
              style={{ marginBottom: '16px' }}
            >
              {availableIndicators.map((indicator) => (
                <MenuItem key={indicator} value={indicator}>
                  {indicator}
                </MenuItem>
              ))}
            </Select>

            {/* Step 3: Select Second Confluence Indicator */}
            <Typography>Select Second Confluence Indicator:</Typography>
            <Select
              value={indicator2}
              onChange={(e) => setIndicator2(e.target.value)}
              fullWidth
              style={{ marginBottom: '16px' }}
            >
              {availableIndicators.map((indicator) => (
                <MenuItem key={indicator} value={indicator}>
                  {indicator}
                </MenuItem>
              ))}
            </Select>

            {/* Step 4: Select Third Confluence Indicator */}
            <Typography>Select Third Confluence Indicator:</Typography>
            <Select
              value={indicator3}
              onChange={(e) => setIndicator3(e.target.value)}
              fullWidth
              style={{ marginBottom: '16px' }}
            >
              {availableIndicators.map((indicator) => (
                <MenuItem key={indicator} value={indicator}>
                  {indicator}
                </MenuItem>
              ))}
            </Select>

            {/* Submit Button */}
            <Button
              variant="contained"
              color="primary"
              onClick={handleSubmit}
              fullWidth
              style={{ marginTop: '16px' }}
            >
              Log Trade
            </Button>
          </Paper>
        </Grid>

        {/* Display Logged Trades */}
        <Grid item xs={12}>
          <Paper elevation={3} style={{ padding: '16px' }}>
            <Typography variant="h6" gutterBottom>
              Logged Trades
            </Typography>
            <Table>
              <TableHead>
                <TableRow>
                  <TableCell>Asset</TableCell>
                  <TableCell>Indicators</TableCell>
                  <TableCell>Actions</TableCell>
                </TableRow>
              </TableHead>
              <TableBody>
                {trades.map((trade, index) => (
                  <TableRow key={index}>
                    <TableCell>{trade.asset}</TableCell>
                    <TableCell>
                      {trade.indicators.map((indicator, i) => (
                        <span key={i}>
                          {indicator.charAt(0).toUpperCase()}
                          {indicator.split(' ').map((word) => word.charAt(0)).join('')}{' '}
                        </span>
                      ))}
                    </TableCell>
                    <TableCell>
                      <IconButton onClick={() => handleDelete(index)} color="error">
                        <DeleteIcon />
                      </IconButton>
                    </TableCell>
                  </TableRow>
                ))}
              </TableBody>
            </Table>
          </Paper>
        </Grid>
      </Grid>
    </Container>
  );
};

export default Dashboard;
